import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";

import Main from './pages/main';
import Unique from './pages/unique';
import React, {useEffect} from 'react';
import axios from 'axios';

function App() {
  return(
  <Router>
    <Switch>
    <Route path="/unique">
        <Unique/>
      </Route>
      <Route path="/">
        <Main/>
      </Route>
    </Switch>
  </Router> 
  ); 
}

export default App;
